import prognozCSS from "../styles/prognoz.module.css";
import cloudwithrain from "../cloudwithrain.svg";
import cloudwithrainandstorm from "../cloudWithrainandstorm.svg";
import moon from "../moon.svg";
import moonandcloud from "../moonandcloud.svg";
import React from "react";

const Budni = [
  {
    day: "Вчера",
    date: "06.06",
    weather: { cloudwithrain },
  },
  {
    day: "Сегодня",
    date: "07.06",
    weather: { cloudwithrain },
  },
  {
    day: "Завтра",
    date: "08.06",
    weather: { cloudwithrainandstorm },
  },
  {
    day: "Среда",
    date: "09.06",
    weather: { cloudwithrain },
  },
  {
    day: "Четверг",
    date: "10.06",
    weather: { cloudwithrain },
  },
];

function Prognoz() {
  return (
    <>
      <div className={prognozCSS.mainContainer}>
        <div className={prognozCSS.eachDay}>
          <p>вчера</p>
          <p>06.06</p>
          <img
            src={cloudwithrain}
            className={prognozCSS.images}
            alt="cloudwithrains"
          />
        </div>
        <div className={prognozCSS.eachDay}>
          <p>сегодня</p>
          <p>07.06</p>
          <img
            src={cloudwithrain}
            className={prognozCSS.images}
            alt="cloudwithrains"
          />
        </div>
        <div className={prognozCSS.eachDay}>
          <p>завтра</p>
          <p>08.06</p>
        </div>
        <div className={prognozCSS.eachDay}>
          <p>ср</p>
          <p>09.06</p>
          <img
            src={cloudwithrain}
            className={prognozCSS.images}
            alt="cloudwithrains"
          />
        </div>
        <div className={prognozCSS.eachDay}>
          <p>чт</p>
          <p>10.06</p>
          <img
            src={cloudwithrain}
            className={prognozCSS.images}
            alt="cloudwithrains"
          />
        </div>
      </div>
    </>
  );
}

export default Prognoz;
